import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';
import "bootstrap/dist/css/bootstrap.min.css";
const StockDetailPage = () => {
  const { id } = useParams(); // Get the id from the URL
  const [stockDetails, setStockDetails] = useState(null);

  useEffect(() => {
    axios
      .get(`http://127.0.0.1:8000/${id}`)
      .then((response) => {
        setStockDetails(response.data);
      })
      .catch((err) => {
        alert(err);
      });
  }, [id]);

  const handleSave = (id) => {
    axios
      .put(`http://127.0.0.1:8000/${id}/`)
      .then(() => {
        alert("Data updated successfully!");
      })
      .catch((err) => {
        alert("Error updating data: " + err);
      });
  };

  return (
    <div className="App">
      <h2 className='App-header'>Stock Details for ID: {id}</h2>
      {stockDetails ? (
        <div className='container'>
        <table className='table'>            
          <tr><th>Date</th> <td>{stockDetails.date}</td></tr>
          <tr><th>Trade Code</th> <td> {stockDetails.trade_code}</td></tr>
          <tr><th>High</th> <td>{stockDetails.high}</td></tr>
          <tr><th>Low </th> <td>{stockDetails.low}</td></tr>
          <tr><th>Open</th> <td> {stockDetails.open}</td></tr>
          <tr><th>Close </th> <td>{stockDetails.close}</td></tr>
          <tr><th>Volume </th> <td>{stockDetails.volume}</td></tr>
        </table>
        <form className='detail_form'>
            <label>Date</label><input value={stockDetails.date}/> <br/>
            <label>Trade Code</label><input value={stockDetails.trade_code}/> <br/>
            <label>High</label><input value={stockDetails.high}/> <br/>
            <label>Low</label><input value={stockDetails.low}/> <br/>
            <label>Open</label><input value={stockDetails.open}/> <br/>
            <label>Close</label><input value={stockDetails.close}/> <br/>
            <label>Volume</label><input value={stockDetails.volume}/> <br/>
        </form>

        <button onClick={()=> handleSave(stockDetails)}>Save</button>
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
};

export default StockDetailPage;
